import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { data } = this.props;

    return (
      <div className="main">
        {data.cards.map((data, i) => (
          <Cards
            key={i}
            name={data.title}
            subtitle={data.subtitle}
            text={data.text}
            image_url={data.image_url}
            href_link={data.href}
          />
        ))}
      </div>
    );
  }
}

export default CardList;
